import './controleMensal.css';
import React, { useEffect, useState } from 'react';

const ControleMensal = () => {

    const [loading, setLoading] = useState(false);

    if (loading) {
        return <p>Loading...</p>;
    }

  return (
    <div class="container">
        <div class="row">
            <div class="col-lg">
                <div className='categoria-box'>
                    <h1>Alimentos</h1>
                </div>
            </div>
            <div class="col-lg">
                <div className='categoria-box'>
                    <h1>Animais</h1>
                </div> 
            </div>
            <div class="col-lg">
                <div className='categoria-box'>
                    <h1>Casa</h1>
                </div>           
            </div>
        </div>
        
    </div>
  );

};
export default ControleMensal;
